var myApp=angular.module("myApp",["ngRoute","appControllers"]),appControllers=angular.module("appControllers",[]);myApp.config(["$routeProvider","$httpProvider",function(a,b){a.when("/home",{templateUrl:"/views/login.html",controller:"LogInController"}).when("/registration",{templateUrl:"/views/registration.html",controller:"RegistrationController"}).when("/player",{templateUrl:"/views/player.html",controller:"PlayerController"}).when("/combat",{templateUrl:"/views/combat.html",controller:"CombatController"}).when("/win",{templateUrl:"/views/win.html",controller:"WinController"}).when("/lose",{templateUrl:"/views/lose.html",controller:"LoseController"}).otherwise({redirectTo:"/home"}),b.interceptors.push(["$location","$q",function(a,b){return{response:function(a){return a},responseError:function(a){return 401===a.status&&alert("Incorrect Username or Password"),b.reject(a)}}}])}]);